window.bookSummaryJSON = "<p><b>The message came warning that Nate's friends had been captured.</b></p> <p>Aliens are abducting juveniles across the galaxy, and every species is a target, including humans. Nate is certain he knows who's responsible, but it's impossible because they're supposed to be dead.</p> <p>Determined to uncover the truth and rescue his friends, Nate embarks on a journey that leads him down a galactic rabbit hole, exposing the darker undercurrents of galactic society and the fight for justice.</p> <p>For Nate, it's personal. For everyone else, it'll be costly.</p> <p>Embark on the adventure of a lifetime with bestselling Author Ken Lozito in this brand-new science fiction series. If you're a fan of old-school heroes and villains in a galaxy full of unknowns, then this is the adventure for you.</p>"; 
